import React, { useEffect, useState } from "react";

import { _getFavsList } from "./../../util/req";
export default function Index() {
  const [List, setList] = useState([]);

  const getList = async () => {
    var data = await _getFavsList(JSON.parse(localStorage.getItem("user"))._id);
    var mpdata = data.data.map((it, index) => ({
      ...it,
      ...it.place[0],
    }));
    setList(mpdata);
    console.log("data -> :", mpdata);
  };
  useEffect(() => {
    getList();
  }, []);

  return (
    <div className="info-center">
      <table>
        <thead>
          <tr>
            <th>HOSPNAME</th>
            <th>NAME</th>
            <th>FORMATTED_ADDRESS</th>
            <th>WEBSITE</th>
            <th>TOPWAIT</th>
            <th>RATING</th>
            <th>ICON</th>
          </tr>
        </thead>
        <tbody>
          {List.map((it, index) => (
            <tr key={index}>
              <td>{it.wait.hospName}</td>
              <td>{it.name}</td>
              <td>{it.formatted_address}</td>
              <td>{it.website}</td>
              <td>{it.wait.topWait}</td>
              <td>{it.wait.rating}</td>
              <td>{it.wait.icon}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
